CREATE SEQUENCE installation_ownership_seq MINVALUE 0 MAXVALUE 999999999999999999 INCREMENT BY 1 START WITH 1 CACHE 1 NO CYCLE;

CREATE TABLE "installation_ownership"
(
"id" bigint,
"account_id" bigint constraint fk_installation_ownership_account references account,
"installation_id" bigint constraint fk_installation_ownership_installation references compliant_entity,
"ownership_date" TIMESTAMP NOT NULL,
"permit_identifier" VARCHAR(1020)  NOT NULL,
"status" VARCHAR(50) NOT NULL,
primary key(id)
);

COMMENT ON TABLE "installation_ownership" IS 'Installation Ownership';
COMMENT ON COLUMN "installation_ownership"."id" IS 'The primary key';
COMMENT ON COLUMN "installation_ownership"."account_id" IS 'The referenced account';
COMMENT ON COLUMN "installation_ownership"."installation_id" IS 'The referenced installation';
COMMENT ON COLUMN "installation_ownership"."permit_identifier" IS 'Id of the permit for this installation';
COMMENT ON COLUMN "installation_ownership"."status" IS 'The status can be active or inactive. For every installation only one InstallationOwnership record will have status ACTIVE a given point in time.';

-- migration for existing installations
insert into installation_ownership(id,account_id,installation_id,permit_identifier,status,ownership_date)
select nextval('installation_ownership_seq'), a.id,a.compliant_entity_id, i.permit_identifier,'ACTIVE',now()
from account a, compliant_entity ce, installation i where a.compliant_entity_id=ce.id and ce.id=i.compliant_entity_id;

CREATE SEQUENCE account_ownership_seq MINVALUE 0 MAXVALUE 999999999999999999 INCREMENT BY 1 START WITH 1 CACHE
1 NO CYCLE;

CREATE TABLE "account_ownership"
(
"id"                bigint,
"account_id"        bigint
constraint fk_account_ownership_account references account,
"account_holder_id" bigint
constraint fk_account_ownership_account_holder references account_holder,
"status"            VARCHAR(50) NOT NULL,
"date_of_ownership" TIMESTAMP   NOT NULL,
primary key (id)
);

COMMENT ON TABLE "account_ownership" IS 'Account Ownership';
COMMENT ON COLUMN "account_ownership"."id" IS 'The primary key';
COMMENT ON COLUMN "account_ownership"."account_id" IS 'The referenced account';
COMMENT ON COLUMN "account_ownership"."account_holder_id" IS 'The referenced account holder';
COMMENT ON COLUMN "account_ownership"."date_of_ownership" IS 'The date that the ownership was activated';
COMMENT ON COLUMN "account_ownership"."status" IS 'The status can be active or inactive. For every account
only one Account Ownership record will have status ACTIVE a given point in time.';

-- migration for existing accounts
insert into account_ownership(id, account_id, account_holder_id, status, date_of_ownership)
select nextval('account_ownership_seq'), a.id, a.account_holder_id, 'ACTIVE', now()
from account a
inner join account_holder ah on ah.id = a.account_holder_id;
